          }
        />

        <Route
          path="/thankyou"
          element={
            <ThankYouScreen
              survey={surveyData}
              aiPractice={aiPracticeResponse}
              aiExperiment={aiExperimentResponse}
              noAiPractice={noAiPracticeResponse}
              noAiExperiment={noAiExperimentResponse}
              onReturnHome={handleReturnHome}
            />
          }
        />
      </Routes>
    </HashRouter>
  );
};

